import { Formik } from "formik";


const login = (formData : Object) => {
    console.log(formData)
}

const Login = () => {
    return(
        <div>
            <Formik initialValues={{email : '', password : ''}}
                    onSubmit={(values) => login(values)}>

            </Formik>
        </div>
    )
}

export default Login;
